import myprojects from "../components/Contents/ProjectContents/myprojects";

const Projects = () => {
  return (
    <div>
      <myprojects />
      <h2>My Projects Page!</h2>
      <p>Hi, There. You are welcome on my projects page.</p>
    </div>
  );
};

export default Projects;
